import React from 'react';
import Button from '@material-ui/core/Button';
import { NavLink } from "react-router-dom";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import './App.css';



function Buttons(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <Grid container spacing={24}>
        <Grid item xs={12}>      
      <NavLink to="/" activeClassName="hurray">
        <Button >
          Accueil
        </Button>
      </NavLink>
      <NavLink to="/Summary" activeClassName="hurray">
        <Button >
          Sommaire
        </Button>
      </NavLink>
      <NavLink to="/History" activeClassName="hurray">
        <Button >
          Bio
        </Button>
      </NavLink>
      <NavLink to="/Skills" activeClassName="hurray">
        <Button disabled >
          Compétences
        </Button> 
      </NavLink>
      <NavLink to="/Works" activeClassName="hurray">
        <Button href="#text-buttons" >
          Réalisations
        </Button>
      </NavLink>
      </Grid>
      </Grid>
    </div>)
}

Buttons.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(Buttons);
